  color: #9b815d;
}
.section5 .inner ul li .detail {
  margin-top: 10px;
  margin-bottom: 5px;
  padding-top: 2px;
  padding-right: 15px;
  padding-bottom: 2px;
  padding-left: 15px;
  position: absolute;
  top: -40px;
  bottom: 0;
  left: 0;
