@import "./mixin";

// HEADER
header {
    @include position(fixed, $top: 0);
    @include transition;
    width: $full;
    height:80px;
    z-index:1100;
    background:rgba(0,0,0,.6);
    border-bottom:1px solid #333;
    &.on {
        @include position(fixed, $top: 0 !important);
    }
    .menu {
        display:inline-block;
        @include position(absolute, $top: 50%, $right: 50px);
        @include translateY;
        z-index:1;
        mix-blend-mode:difference;
        @include transition($transition: .3s);
    }
    .path {
        .line {
            width: 35px; 
            height: 3px;
            background-color: #ecf0f1;
            display: block;
            margin: 8px auto;
            @include transition($transition: .3s);
            &:hover {
                cursor: pointer;
            }
        }
        &.is-active {
            .line {
                &:nth-child(1) {
                    opacity: $zero;
                    @include translateX(-100%);
                }
                &:nth-child(3) {
                    opacity: $zero;
                    @include translateX(100%);
                }
            }
        }
    }
    &.fixed {
        @include position(fixed, $top:0);
        height:80px;
        background:rgba(0,0,0,.9);
        @include transition($transition: 1s);
        &.menu {
            top : 17px;
        }
    }
}

// logo
.logo {
    @include position(absolute, $top:50%, $left:50px);
    @include translateY;
    width:50px;
    z-index:1;
    mix-blend-mode:difference;
    @include transition($transition: .3s);
    color:#fff;
    a {
        font : {
            size: 32px;
            weight: 700;
        }
        letter-spacing:-0.05em;
    }
}

// overlay
.overlay {
    @include position(fixed, $top: 0, $left: 0);
    z-index: 2;
    width: $full;
    height: $full;
    background: #000;
    opacity: $zero;
    visibility: hidden;
    @include center;
    &.is-open {
        z-index:1111;
        opacity:1;
        visibility:visible;
        animation:menu-animation .5s linear;
        &::before {
            display:block;
            content:'';
            width:50px;
            height:50px;
            border-radius: 9999px;
            background-color:#fff;
            @include position(absolute, $top: 100%, $left: 50%);
            animation:menu-animation2 1.5s linear forwards;
            opacity:1;
            @include translate;
            margin:0 auto;
            z-index:-1;
        }
        $transition : opacity 1.1s cubic-bezier(0.18,0.45,0.1,0.98),transform 0.7s cubic-bezier(0.18,0.45,0.1,0.98);
        ul {
            li {
                transition: $transition;
                opacity:1;
            }
        }
        .closeBtn {
            transition: $transition;
            transition-delay:2.6s;
        }
    }
    ul {
        @for $i from 1 through 4 {
            li:nth-child(#{$i}) {
                transition-delay:1.3s + calc($i / 3);
            }
        }
        z-index:9999;
        height:auto;
        li {
            opacity:$zero;
            text-align:center;
            @include translateY;
            a {
                display:inline-block;
                width:auto;
                @include position(relative);
                color:#000;
                font-weight:800;
                font-size:72px;
                &::before {
                    display:block;
                    content:'';
                    width:0;
                    height:40px;
                    background:#9b815d;
                    @include position(absolute, $bottom: 5px, $left: -20px);
                    @include transition(.7s);
                    z-index:-1;
                    opacity:.5;
                }
                &:hover::before {
                    width:calc(100% + 40px);
                }
            }
        }
        li + li {
            @include margin($top: 32px);
        }
    }
    .closeBtn {
        @include position(absolute, $top: 15px, $right: 35px);
        width: 60px;
        height: 60px;
        @include margin($left: -30px);
        font-size: $zero;
        background-color: #000;
        border-radius: $full;
        opacity:$zero;
        &::before, &::after {
            content: "";
            @include position(absolute, $top: 50%, $left: 50%);
            width: 30px;
            height: 3px;
            @include margin($top: -1px, $left: -15px);
            background-color: #fff;
            border-radius: 3px;
        }
        &::before {
            transform: rotate(-45deg);
        }
        &::after {
            transform: rotate(45deg);
        }
    }
}

@keyframes menu-animation {
  0% {
	opacity:0;
  }
  100% {
	opacity:1;
  }
 }
@keyframes menu-animation2 {
  0% {
    color: transparent;
    width: 4em;
	height: 4em;
	top:0em;
  }
  50% {
    width: 1.5em;
    height: 1.5em;
  }
  to {
    width: 5999px;
    height: 5999px;
    border-radius: 9999px;
    color: transparent;
  }
}

// topBtn
.topBtn {
    @include center;
    width:50px;
    height:50px;
    background-color:rgba(51,51,51,.8);
    color:#fff;
    @include position(fixed, $right: 50px, $bottom: 50px);
    cursor:pointer;
    opacity:$zero;
    @include transition;
    &::before {
        display:block;
        content:'';
        width:24px;
        height:13px;
        background:url("../image/button/topBtn.png") 0 0 no-repeat;
        background-size:contain;
    }
    &.on {
        opacity:1;
    }
    &:hover {
        background-color:rgba(51,51,51,.5);
    }
}

// myCanvas
#myCanvas {
    z-index:0;
    @include position(absolute, $top:0, $bottom:0, $left:50%);
    @include margin($left:-50%);
    opacity:.3;
    max-width:1920px;
}

// section : common
.section {
    position:relative; 
    background: var(--main-bg-color); 
    color: #fff; 
    min-height:800px; 
    height:100vh; 
    @include center;
    overflow:hidden;
}

.innerWrap {
    position:relative;
    overflow:hidden;
    width:1200px;
    margin:0 auto;
    @include transition;
    .box {
        display:flex;
        position:relative;
    }
    & > .title {
        position: relative;
        height:80px;
        font-weight:700;
        p {
            color: #fff;
            font-size: 70px;
            position: absolute;
            @include translate(0);
            &:nth-child(1){
                color: transparent;
                -webkit-text-stroke: 1px #fff;
            }
            &:nth-child(2){
                color: #fff;
                animation: animate 4s ease-in-out infinite;
            }
        }
    }
}

@keyframes animate {
	0%,
	100% {
		clip-path: polygon(
			0% 45%,
			16% 44%,
			33% 50%,
			54% 60%,
			70% 61%,
			84% 59%,
			100% 52%,
			100% 100%,
			0% 100%
		);
	}

	50% {
		clip-path: polygon(
			0% 60%,
			15% 65%,
			34% 66%,
			51% 62%,
			67% 50%,
			84% 45%,
			100% 46%,
			100% 100%,
			0% 100%
		);
	}
}


// section1
.section1 {
    width:$full;
    height:100vh;
    overflow:hidden;
    background-color:#000;
}

.objectArea {
    width:450px;
    height:450px;
    background:#000;
    border-radius:$full;
    @include position(absolute, $top:calc(50% + 100px), $left:50%);
    @include translate;
    z-index:100;
    opacity:1;
    animation: blingbling 5s linear infinite;
    transition:width .5s, height .5s;
    opacity:0;
    &::before {
        display:block;
        content:'';
        width:$full;
        height:$full;
        background:#000;
        @include position(absolute, $top:0, $left:0);
        border-radius:$full;
        z-index:-1;
    }
    img {
        width:$full;
        height:$full;
        opacity:.3;
        animation: rotate 240s linear .1s;
        filter:grayscale(1);
    }
}

.videoBg {
    @include position(relative);
    width:100vw;
    height:100vh;
    opacity:.2;
}
.videoBg2 {
    @include position(absolute, $top:0, $left:0);
    opacity:.3;
}

.slogan {
    width:$full;
    color:#fff;
    @include position(absolute, $top:50%, $left:50%);
    @include translate;
    z-index:1000;
    font-size:4em;
    line-height:1;
    font-weight:800;
    text-align:center;
    span {
        font-size:28px;
        font-weight:300;
        letter-spacing:.1em;
    }
    .typing {
        min-height:72px;
    }
    .subtxt {
        font-size:.6em;
        @include position(absolute, $bottom:-120px, $left:50%);
        @include translateX;
        width:$full;
        opacity:$zero;
    }
}

.fix_bn {
    @include position(absolute, $top:-34px);
    overflow: hidden;
    width: $full;
    height: 34px;
    border-bottom: 1px solid #000;
    font-size: $zero;
    z-index:1000;
    @include transition;
    > div {
        overflow: hidden;
        @include position(absolute, $top:0, $left:0);
        z-index: 1;
        width: $full;
        background-color: #000;
        white-space: nowrap;
        &.right {
            @include position(absolute, $right:0, $left:auto);
            right: 0;
            left: auto;
            background-color: #fff;
            clip-path: polygon(calc(50% + 20px) 0%, 100% 0%, 100% 100%, 50% 100%);
        }
        p {
            display: inline-block;
            vertical-align: middle;
            animation: marquee 40000ms linear infinite;
            span {
                display: inline-block;
                height: 34px;
                @include margin($left:190px);
                color: #000;
                font-size: 17px;
                font-weight: 700;
                vertical-align: middle;
                line-height: 34px;
            }
        }
        &.left {
            p {
                span {
                    color:#fff;
                }
            }
        }
    }
    &.on {
        top:-68px;
    }
}

@keyframes rotate {
    from {
      -webkit-transform: rotate(0deg);
      -o-transform: rotate(0deg);
      transform: rotate(0deg);
    }
    to {
      -webkit-transform: rotate(360deg);
      -o-transform: rotate(360deg);
      transform: rotate(360deg);
    }
}
  
@keyframes blingbling {
    0% {
      filter:saturate(100%);
    }
    80% {
      filter:saturate(200%);
    }
    100% {
      filter:saturate(100%);
    }
}

@keyframes marquee {
    from { transform: translateX(0); }
    to { transform: translateX(-50%); }
}


// section2
.section2 {
    background: linear-gradient(0deg, rgba(0,0,0,1) 0%, rgba(0,0,0,1) 19%, rgba(14,14,14,1) 100%);
    .innerWrap {
        .box {
            @include margin($bottom:30px);
            justify-content: center;
        }
        .imgArea {
            width:300px;
            height:auto;
            @include margin($right:50px);
            overflow:hidden;
            @include transition;
            img {
                filter:grayscale(.4);
            }
        }
        .txtArea {
            font-weight:500;
            .title {
                position:relative;
                font-size:2.11em;
                font-weight:400;
                z-index:1;
                strong {
                    position:relative;
                    font-weight:800;
                }
                .highlight {
                    &::before {
                        content: "";
                        display:block;
                        @include position(absolute, $bottom:0, $left:-2.5%);
                        width: calc($full + 5%);
                        height:15px;
                        background-color: #9b815d;
                        opacity:1;
                        z-index:-1;
                    }
                }
            }
            .txt {
                @include position(relative);
                @include margin($top:15px, $bottom:15px);
                line-height:1.6;
                z-index:1;
                word-break:keep-all;
                span {
                    font-size:1.1em;
                    font-weight:600;
                    @include margin($right:2px);
                }
            }
        }
    }
    .btnGroup {
        text-align: center;
    }
}


// section3
@mixin effectLayout {
    @include position(relative);
    border-radius:0 0 60px 0 / 0 0 75px 0;
    overflow:hidden;
}

@mixin effect {
    display:block;
    content:'';
    width:$full;
    height:$full;
    background-color:rgba(0,0,0,.4);
    opacity:$zero;
    @include position(absolute);
    @include transition(.2s);
}

.section3 {
    background-color:#111;
    .workSwiper {
        @include margin($top:50px, $bottom:70px);
        @include padding($bottom:70px);
        .swiper-slide {
            .imgArea {
                @include effectLayout;
                &:before {
                    @include effect;
                }
            }
            &:hover {
                .imgArea {
                    &::before {
                        opacity:1;
                    }
                }
            }
        }
        .swiperBtnGroup {
            @include position(absolute, $bottom:50px, $left:50%);
            @include translateX;
            width:80px;
            background-color:#fff;
        }

        @mixin buttonStyle {
            width:32px;
            height:32px;
            background-size:32px;
        }
        .swiper-button-prev{
            @include buttonStyle();
            background-image:url("../image/button/swiper_left.png");
            left:0;
        }
        .swiper-button-next {
            @include buttonStyle();
            background-image:url("../image/button/swiper_right.png");
            right:0;
        }
        .swiper-pagination-progressbar {
            @include position(absolute, $top:auto, $bottom:0);
            .swiper-pagination-progressbar-fill {
                background:#fff;
            }
        }
    }
    .innerWrap {
        .txtArea {
            @include margin($top:15px);
            .title {
                font : {
                    weight:700;
                    size:28px;
                }
                @include margin($bottom:20px);
                span {
                    font : {
                        weight:400;
                        size:18px;
                    }
                    @include margin($left:5px);
                }
            }
            p {
                display:flex;
                font-size:14px;
                b {
                    @include padding($top: 1px, $bottom: 1px, $right:7px, $left: 7px);
                    @include margin($right: 12px);
                    border-radius:4px;
                    min-width:70px;
                    height:24px;
                    display:inline-block;
                    text-align:center;
                    font-size:14px;
                    background:#fff;
                    color:#000;
                }
            }
            p + p {
                @include margin($top: 10px);
            }
            .color {
                @include margin($top: 10px);
                display:flex;
                align-items:center;
                p {
                    display:inline-flex;
                    align-items:center;
                    font-size:14px;
                    font-weight:700;
                    > span {
                        display:inline-block;
                        width:14px;
                        height:14px; 
                        @include position(relative, $top:1px);
                        @include margin($right:6px, $left:12px);
                    }
                }
                p + p {
                    @include margin($top:0, $left:10px);
                }
            }
        }
        .btnGroup {
            @include margin($top:60px);
        }
    }
}


// section4
.section4 {
    .skillSwiper {
        @include margin($top:50px, $bottom:70px);
        @include padding($bottom:70px);        
        .swiper-slide {
            .imgArea {
                @include effectLayout;
                &:before {
                    @include effect;
                }
            }
            &:hover {
                .imgArea {
                    &::before {
                        opacity:1;
                    }
                }
            }
        }
        .swiperBtnGroup {
            @include position(absolute, $bottom:50px, $left:50%);
            @include translateX;
            width:80px;
            background-color:#fff;
        }

        @mixin buttonStyle {
            width:32px;
            height:32px;
            background-size:32px;
        }
        .swiper-button-prev{
            @include buttonStyle();
            background-image:url("../image/button/swiper_left.png");
            left:0;
        }
        .swiper-button-next {
            @include buttonStyle();
            background-image:url("../image/button/swiper_right.png");
            right:0;
        }
        .swiper-pagination-progressbar {
            @include position(absolute, $top:auto, $bottom:0);
            .swiper-pagination-progressbar-fill {
                background:#fff;
            }
        }
    }
    .innerWrap {
        .txtArea {
            @include margin($top:15px);
            .title {
                font : {
                    weight:700;
                    size:28px;
                }
                @include margin($bottom:20px);
                span {
                    font : {
                        weight:400;
                        size:18px;
                    }
                    @include margin($left:5px);
                }
            }
            p {
                display:flex;
                font-size:14px;
                b {
                    @include padding($top: 1px, $bottom: 1px, $right:7px, $left: 7px);
                    @include margin($right: 12px);
                    border-radius:4px;
                    min-width:70px;
                    height:24px;
                    display:inline-block;
                    text-align:center;
                    font-size:14px;
                    background:#fff;
                    color:#000;
                }
            }
            p + p {
                @include margin($top: 10px);
            }
            .color {
                @include margin($top: 10px);
                display:flex;
                align-items:center;
                p {
                    display:inline-flex;
                    align-items:center;
                    font-size:14px;
                    font-weight:700;
                    > span {
                        display:inline-block;
                        width:14px;
                        height:14px; 
                        @include position(relative, $top:1px);
                        @include margin($right:6px, $left:12px);
                    }
                }
                p + p {
                    @include margin($top:0, $left:10px);
                }
            }
        }
        .btnGroup {
            @include margin($top:60px);
        }
        .row {
            display:flex;
            align-items:center;
            &.f_start {
                align-items:flex-start;
                word-break:keep-all;
                @include margin($top:10px);
                div {
                    display:flex;
                    flex-wrap:wrap;
                    align-items:center;
                    width:$full;
                    font-size:14px;
                    img {
                        @include margin($right:5px);
                        width:20px;
                        height:20px;
                    }
                }
                div + div {
                    @include margin($top:7px);
                }
            }
        }
    }
}

// section5
.section5 {
    background-color:#111;
    .inner {
        width:$full;
        height:auto;
        border-radius:20px;
        margin:0 auto;
        color:#000;
        z-index:10;
        @include padding($top:50px, $bottom:50px);
        ul {
            border:1px solid #555;
            border-width:1px 0 1px 0;
            li {
                position:relative; 
                width:$full;
                box-shadow: rgba(0, 0, 0, 0.08) 0px 10px 15px 0px, rgba(0, 0, 0, 0.06) 0px 0px 0px 1px;
                @include padding($top:15px, $right:20px, $bottom:15px, $left:20px);
                display:flex;
                align-items:center;
                &::before {
                    display:block;
                    content:'';
                    width:$zero;
                    height:1px;
                    background:#fff;
                    @include position(absolute, $bottom:0, $left:0);
                    @include transition(1.2s);
                }
                &:hover::before {
                    width:100%;
                }
                div {
                    display:flex;
                    align-items:center;
                    color:#fff;
                    line-height:1.8;
                    font-size:16px;
                    &.row {
                        > p {
                            @include margin($right:30px);
                            min-width:115px;
                        }
                    }
                    > p {
                        @include position(relative);
                        font-size:16px;
                        word-break:keep-all;
                        &::before {
                            display:block;
                            content:'';
                            width:1px;
                            height:14px;
                            background-color:#fff;
                            @include position(absolute, $top:50%, $left:-15px);
                            @include translateY;
                        }
                        b {
                            color:#fff;
                        }
                        &.tit {
                            @include position(relative);
                            font-size:16px;
                            color:#fff;
                            font-weight:600;
                            padding-left:28px;
                            min-width:150px;
                            &::before {
                                display:block;
                                content:'';
                                width:20px;
                                height:20px;
                                @include position(absolute, $top:50%, $left:0);
                                @include translateY;
                            }
                            $url: "/include/image/main/";
                            &.jnet::before {
                                background:url("#{$url}/ico_jnet.png");
                            }
                            &.wisa::before {
                                background:url("#{$url}/ico_wisa.png");
                            }
                            &.design::before {
                                background:url("#{$url}/ico_design.png");
                            }
                            &.eims::before {
                                background:url("#{$url}/ico_eims.png");
                            }
                            &.sisoft::before {
                                background:url("#{$url}/ico_sisoft.png");
                            }
                            &.nsglobal::before {
                                background:url("#{$url}/ico_nsglobal.png");
                            }
                        }
                    }
                }
                &.on {
                    div {
                        p {
                            &.date {
                                b {
                                    color:#9b815d;
                                }
                            }
                        }
                    }
                }
                .detail {
                    @include margin($top:10px, $bottom:5px);
                    @include padding($top:2px, $right:15px, $bottom:2px, $left:15px);
                    @include position(absolute, $top:-40px, $bottom:0, $left:0);
                    visibility:hidden;
                    opacity:0;
                    background:#fff;
                    color:#000;
                    font-size:14px;
                    width:auto;
                    max-width:100%;
                    height:35px;
                    border-radius:30px;
                    @include transition(.1s);
                    font-weight:600;
                    text-align:center;
                    border:1px solid #000;
                    &::before {
                        display:block;
                        content:'';
                        width: 0;
                        height: 0;
                        border-bottom: 10px solid transparent;
                        border-top: 5px solid #fff;
                        border-left: 5px solid transparent;
                        border-right: 5px solid transparent;
                        @include position(absolute, $bottom:-15px, $left:65px);
                    }
                    p {
                        @include text-overflow;
                        font-size:14px;
                    }
                }
                &:hover {
                    .detail {
                        visibility:visible;
                        opacity:1;
                    }
                }
            }
            li + li {
                @include padding($top:10px);
                border-top:1px solid #555;
            }
        }
    }
}


// footer
.footer {
    width:$full;
    @include padding($top:40px, $right:30px, $bottom:40px, $left:30px);
    background:#000;
    font-size:14px;
    display:flex;
    flex-wrap:wrap;
    justify-content:center;
    border-top:1px solid #333;
    p {
        width:$full;
        text-align:center;
        color:#ddd;
        font-weight:600;
        word-break:keep-all;
        &:last-child {
            color:#777;
        }
    }
}



@media screen and (max-width: 1400px){

    // header
    header {
        height:70px;
        .path {
            .line {
                width:30px;
                height:2px;
            }
        }
    }
    
	.objectArea {
        width:430px;
        height:430px;
    }

	.slogan {
        font-size:3.6em;
    }

	.innerWrap {
        width:1100px;
    }

    .section3 .workSwiper, .section4 .skillSwiper {
        @include margin($bottom:20px);
        @include padding($bottom:40px);
    }
}

@media screen and (max-width: 1200px){
	.logo {
        left:40px;
    }
	header {
        .menu {
            right:40px;
        }
    }
	.overlay {
        ul {
            li {
                a {font-size:3.6em;}
            }
        }
    }

	.topBtn {
        bottom:30px;
        right:30px;
    }

	.section {
        padding:0 40px;
    }
	.innerWrap {
        width:$full;
    }

	.section5 {
        ul {
            li {
                padding:10px 15px;
                div {
                    &.row {
                        > p {
                            margin-right:20px;
                            @include text-overflow(2);
                            &.date {
                                min-width:150px;
                            }
                        }
                    }
                    p {
                        left:-10px;
                    }
                }
            }
        }
    }
}

@media screen and (max-width: 1024px){
	header {
        height:60px;
    }
	.logo {
        left:30px;
    }
	header {
        .menu {
            right:30px;
        }
    }
	.overlay {
        .closeBtn {
            width:50px;
            height:50px;
            right:20px;
            top:12px;
            &::before, &::after {
                width:25px;
                margin-left:-13px;
                margin-top:-2px;
            }
        }
    }

	.section:not(.section1) {
        height:100%;
        min-height:100%;
        padding:70px 30px;
    }
	.innerWrap {
        .box {
            flex-wrap:wrap;
            justify-content:center;
        }
    }

	.slogan {
        font-size:3em;
    }
	
	#myCanvas {
        display:none;
    }
	.section2 {
        .innerWrap {
            .imgArea {
                margin:0 0 40px 0;
            }
            .txtArea {
                text-align:center;
                width:100%;
            }
        }
        .btnGroup {
            margin:0 auto;
            text-align:center;
        }
    }

    .section3, .section4 {
        @include padding($right:0 !important);
    }


	.section5 {
        ul {
            li {
                div {
                    flex-wrap:wrap;
                    width:100%;
                    &.row {
                        > p {
                            min-width:auto;
                            &.con, &.tit {
                                width:100%;
                            }
                            &.tit {
                                color:rgb(98 159 255); font-weight:700;
                            }
                        }
                    }
                }
            }
        } 
    }
}

@media screen and (max-width: 768px){
	.logo {
        a {
            font-size:26px;
        }
    }

	.fix_bn {
        > div {
            p {
                span {
                    font-size:16px;
                }
            }
        }
    } 

	.overlay {
        ul {
            li + li {
                margin-top:24px;
            }
        }
    }
	.overlay {
        .closeBtn {
            width:45px; 
            height:45px;
            right:20px;
            top:12px;
            &::before, &::after {
                width:25px;
                margin-left:-13px;
                margin-top:-2px;
            }
        }
    }
	.topBtn {
        width:36px;
        height:36px;
        bottom:20px;
        right:20px;
        &::before {
            width:16px;
            height:9px;
        }
    }


	.objectArea {
        width:350px;
        height:350px;
    }
	.slogan {
        .typing {
            min-height:auto;
        }
    }

	.section:not(.section1) {
        padding:50px 25px;
    }
	.section2 {
        .innerWrap {
            .imgArea {
                margin:0 0 30px 0;
                width:240px;
            }
        }
    }

	.innerWrap {
        > .title {
            p {font-size:60px;}
        }
    }
}

@media screen and (max-width: 640px){
	.fix_bn {
        > div {
            p {
                span {
                    font-size:15px;
                }
            }
        }
    }
	.overlay {
        ul {
            li {
                a {
                    font-size:2.8em;
                    &::before {
                        height:17px;
                    }
                }
            }
            li + li {
                margin-top:16px;
            }
        }
    }
	

	.objectArea {
        width:280px;
        height:280px;
    }
	.slogan {
        font-size:2.8em;
    }

	.section2 {
        .innerWrap {
            .imgArea {
                width:220px;
            }
        }
    }

	.innerWrap {
        > .title {
            height:auto;
            margin-bottom:25px;
            p {
                font-size:42px;
            }
        }
    }

	.section3 {
        .innerWrap {
            .txtArea {
                .color {
                    p + p {
                        margin-left:0;
                    }
                }
            }
        }
    }

	.section3, .section4 {
        padding-right:0 !important;
    }

	.section3 .workSwiper,
	.section4 .skillSwiper {
        margin:50px 0 20px 0;
        padding-bottom:30px;
    }
	.section4 {
        .innerWrap {
            .row {
                &.f_start {
                    div {
                        img {
                            margin-right:3px;
                        }
                    }
                }
            }
        }
    }

	.section5 {
        ul {
            li {
                padding:7px 7px;
                div {
                    p {
                        font-size:14px;
                    }
                    &.row {
                        > p {
                            margin-right:15px;
                        }
                    }
                }
            }
        }
    }
}

@media screen and (max-width: 500px){
	.logo {
        left:25px;
    }
	.objectArea {
        width:200px;
        height:200px;
    }

	.overlay {
        ul {
            li {
                a {
                    font-size:2em;
                }
            }
            li + li {
                margin-top:10px;
            }
        }
    }

	.section1 {
        min-height:0;
        height:100%;
    }
}

