@mixin center {
    display: flex;
    justify-content: center;
    align-items: center;
}

@mixin position($position, $top: null, $right: null, $bottom: null, $left: null) {
    position: $position;
    top: $top;
    right: $right;
    bottom: $bottom;
    left: $left;
}

@mixin margin($top: null, $right: null, $bottom: null, $left: null) {
    margin-top: $top;
    margin-right: $right;
    margin-bottom: $bottom;
    margin-left: $left;
}

@mixin padding($top: null, $right: null, $bottom: null, $left: null) {
    padding-top: $top;
    padding-right: $right;
    padding-bottom: $bottom;
    padding-left: $left;
}

$translate: translateY(-50%);

@mixin translate($translate: -50%) {
    -webkit-transform: translate($translate, $translate);
    -ms-transform: translate($translate, $translate);
    -o-transform: translate($translate, $translate);
    transform: translate($translate, $translate);
}

@mixin translateX($translate: -50%) {
    -webkit-transform: translateX($translate);
    -ms-transform: translateX($translate);
    -o-transform: translateX($translate);
    transform: translateX($translate);
}

@mixin translateY($translate: -50%) {
    -webkit-transform: translateY($translate);
    -ms-transform: translateY($translate);
    -o-transform: translateY($translate);
    transform: translateY($translate);
}

@mixin transition($transition: .5s) {
    -ms-transition: all $transition ease-in-out;
    -moz-transition: all $transition ease-in-out;
    -o-transition: all $transition ease-in-out;
    -webkit-transition : all $transition ease-in-out;
    transition: all $transition ease-in-out;
}

@mixin text-overflow($lineCount: 1) {
    overflow: hidden;
    white-space: normal;
    text-overflow: ellipsis;
    display: -webkit-box;
    -webkit-line-clamp: $lineCount;
    -webkit-box-orient: vertical;
    word-break: keep-all;
}

$full : 100%;
$zero : 0;

sources.include\\css\\style.css:
header {
  position: fixed;
  top: 0;
  transition: all 0.5s ease-in-out;
  width: 100%;
  height: 80px;
  z-index: 1100;
  background: rgba(0, 0, 0, 0.6);
  border-bottom: 1px solid #333;
}
header.on {
  position: fixed;
  top: 0 !important;
}
header .menu {
  display: inline-block;
  position: absolute;
  top: 50%;
  right: 50px;
  transform: translateY(-50%);
  z-index: 1;
  mix-blend-mode: difference;
  transition: all 0.3s ease-in-out;
}
header .path .line {
  width: 35px;
  height: 3px;
  background-color: #ecf0f1;
  display: block;
  margin: 8px auto;
  transition: all 0.3s ease-in-out;
}
header .path .line:hover {
  cursor: pointer;
}
header .path.is-active .line:nth-child(1) {
  opacity: 0;
  transform: translateX(-100%);
}
header .path.is-active .line:nth-child(3) {
  opacity: 0;
  transform: translateX(100%);
}
header.fixed {
  position: fixed;
  top: 0;
  height: 80px;
  background: rgba(0, 0, 0, 0.9);
  transition: all 1s ease-in-out;
}
header.fixed.menu {
  top: 17px;
}

.logo {
  position: absolute;
  top: 50%;
  left: 50px;
  transform: translateY(-50%);
  width: 50px;
  z-index: 1;
  mix-blend-mode: difference;
  transition: all 0.3s ease-in-out;
  color: #fff;
}
.logo a {
  font-size: 32px;
  font-weight: 700;
  letter-spacing: -0.05em;
}

.overlay {
  position: fixed;
  top: 0;
  left: 0;
  z-index: 2;
  width: 100%;
  height: 100%;
  background: #000;
  opacity: 0;
  visibility: hidden;
  display: flex;
  justify-content: center;
  align-items: center;
}
.overlay.is-open {
  z-index: 1111;
  opacity: 1;
  visibility: visible;
  animation: menu-animation 0.5s linear;
}
.overlay.is-open::before {
  display: block;
  content: "";
  width: 50px;
  height: 50px;
  border-radius: 9999px;
  background-color: #fff;
  position: absolute;
  top: 100%;
  left: 50%;
  animation: menu-animation2 1.5s linear forwards;
  opacity: 1;
  transform: translate(-50%, -50%);
  margin: 0 auto;
  z-index: -1;
}
.overlay.is-open ul li {
  transition: opacity 1.1s cubic-bezier(0.18, 0.45, 0.1, 0.98), transform 0.7s cubic-bezier(0.18, 0.45, 0.1, 0.98);
  opacity: 1;
}
.overlay.is-open .closeBtn {
  transition: opacity 1.1s cubic-bezier(0.18, 0.45, 0.1, 0.98), transform 0.7s cubic-bezier(0.18, 0.45, 0.1, 0.98);
  transition-delay: 2.6s;
}
.overlay ul {
  z-index: 9999;
  height: auto;
}
.overlay ul li:nth-child(1) {
  transition-delay: 1.6333333333s;
}
.overlay ul li:nth-child(2) {
  transition-delay: 1.9666666667s;
}
.overlay ul li:nth-child(3) {
  transition-delay: 2.3s;
}
.overlay ul li:nth-child(4) {
  transition-delay: 2.6333333333s;
}
.overlay ul li {
  opacity: 0;
  text-align: center;
  transform: translateY(-50%);
}
.overlay ul li a {
  display: inline-block;
  width: auto;
  position: relative;
  color: #000;
  font-weight: 800;
  font-size: 72px;
}
.overlay ul li a::before {
  display: block;
  content: "";
  width: 0;
  height: 40px;
  background: #9b815d;
  position: absolute;
  bottom: 5px;
  left: -20px;
  transition: all 0.7s ease-in-out;
  z-index: -1;
  opacity: 0.5;
}
.overlay ul li a:hover::before {
  width: calc(100% + 40px);
}
.overlay ul li + li {
  margin-top: 32px;
}
.overlay .closeBtn {
  position: absolute;
  top: 15px;
  right: 35px;
  width: 60px;
  height: 60px;
  margin-left: -30px;
  font-size: 0;
  background-color: #000;
  border-radius: 100%;
  opacity: 0;
}
.overlay .closeBtn::before, .overlay .closeBtn::after {
  content: "";
  position: absolute;
  top: 50%;
  left: 50%;
  width: 30px;
  height: 3px;
  margin-top: -1px;
  margin-left: -15px;
  background-color: #fff;
  border-radius: 3px;
}
.overlay .closeBtn::before {
  transform: rotate(-45deg);
}
.overlay .closeBtn::after {
  transform: rotate(45deg);
}

@keyframes menu-animation {
  0% {
    opacity: 0;
  }
  100% {
    opacity: 1;
  }
}
@keyframes menu-animation2 {
  0% {
    color: transparent;
    width: 4em;
    height: 4em;
    top: 0em;
  }
  50% {
    width: 1.5em;
    height: 1.5em;
  }
  to {
    width: 5999px;
    height: 5999px;
    border-radius: 9999px;
    color: transparent;
  }
}
.topBtn {
  display: flex;
  justify-content: center;
  align-items: center;
  width: 50px;
  height: 50px;
  background-color: rgba(51, 51, 51, 0.8);
  color: #fff;
  position: fixed;
  right: 50px;
  bottom: 50px;
  cursor: pointer;
  opacity: 0;
  transition: all 0.5s ease-in-out;
}
.topBtn::before {
  display: block;
  content: "";
  width: 24px;
  height: 13px;
  background: url("../image/button/topBtn.png") 0 0 no-repeat;
  background-size: contain;
}
.topBtn.on {
  opacity: 1;
}
.topBtn:hover {
  background-color: rgba(51, 51, 51, 0.5);
}

#myCanvas {
  z-index: 0;
  position: absolute;
  top: 0;
  bottom: 0;
  left: 50%;
  margin-left: -50%;
  opacity: 0.3;
  max-width: 1920px;
}

.section {
  position: relative;
  background: var(--main-bg-color);
  color: #fff;
  min-height: 800px;
  height: 100vh;
  display: flex;
  justify-content: center;
  align-items: center;
  overflow: hidden;
}

.innerWrap {
  position: relative;
  overflow: hidden;
  width: 1200px;
  margin: 0 auto;
  transition: all 0.5s ease-in-out;
}
.innerWrap .box {
  display: flex;
  position: relative;
}
.innerWrap > .title {
  position: relative;
  height: 80px;
  font-weight: 700;
}
.innerWrap > .title p {
  color: #fff;
  font-size: 70px;
  position: absolute;
  transform: translate(0, 0);
}
.innerWrap > .title p:nth-child(1) {
  color: transparent;
  -webkit-text-stroke: 1px #fff;
}
.innerWrap > .title p:nth-child(2) {
  color: #fff;
  animation: animate 4s ease-in-out infinite;
}

@keyframes animate {
  0%, 100% {
