.section1 {
  width: 100%;
  height: 100vh;
  overflow: hidden;
  background-color: #000;
}

.objectArea {
  width: 450px;
  height: 450px;
  background: #000;
  border-radius: 100%;
  position: absolute;
  top: calc(50% + 100px);
  left: 50%;
  transform: translate(-50%, -50%);
  z-index: 100;
  opacity: 1;
  animation: blingbling 5s linear infinite;
  transition: width 0.5s, height 0.5s;
  opacity: 0;
}
.objectArea::before {
  display: block;
  content: "";
  width: 100%;
  height: 100%;
  background: #000;
  position: absolute;
  top: 0;
  left: 0;
  border-radius: 100%;
  z-index: -1;
}
.objectArea img {
  width: 100%;
  height: 100%;
  opacity: 0.3;
  animation: rotate 240s linear 0.1s;
  filter: grayscale(1);
}

.videoBg {
  position: relative;
  width: 100vw;
  height: 100vh;
  opacity: 0.2;
}

.videoBg2 {
  position: absolute;
  top: 0;
  left: 0;
  opacity: 0.3;
}

.slogan {
  width: 100%;
  color: #fff;
  position: absolute;
  top: 50%;
  left: 50%;
  transform: translate(-50%, -50%);
  z-index: 1000;
  font-size: 4em;
  line-height: 1;
  font-weight: 800;
  text-align: center;
}
.slogan span {
  font-size: 28px;
  font-weight: 300;
  letter-spacing: 0.1em;
}
.slogan .typing {
  min-height: 72px;
}
.slogan .subtxt {
  font-size: 0.6em;
  position: absolute;
  bottom: -120px;
  left: 50%;
  transform: translateX(-50%);
  width: 100%;
  opacity: 0;
}

.fix_bn {
  position: absolute;
  top: -34px;
  overflow: hidden;
  width: 100%;
  height: 34px;
  border-bottom: 1px solid #000;
  font-size: 0;
  z-index: 1000;
  transition: all 0.5s ease-in-out;
}
.fix_bn > div {
  overflow: hidden;
  position: absolute;
  top: 0;
  left: 0;
  z-index: 1;
  width: 100%;
  background-color: #000;
  white-space: nowrap;
}
.fix_bn > div.right {
  position: absolute;
  right: 0;
  left: auto;
  right: 0;
  left: auto;
  background-color: #fff;
  -webkit-clip-path: polygon(calc(50% + 20px) 0%, 100% 0%, 100% 100%, 50% 100%);
          clip-path: polygon(calc(50% + 20px) 0%, 100% 0%, 100% 100%, 50% 100%);
}
.fix_bn > div p {
  display: inline-block;
  vertical-align: middle;
  animation: marquee 40000ms linear infinite;
}
.fix_bn > div p span {
  display: inline-block;
  height: 34px;
  margin-left: 190px;
  color: #000;
  font-size: 17px;
  font-weight: 700;
  vertical-align: middle;
  line-height: 34px;
}
.fix_bn > div.left p span {
  color: #fff;
}
.fix_bn.on {
  top: -68px;
}

@keyframes rotate {
  from {
    transform: rotate(0deg);
  }
  to {
    transform: rotate(360deg);
  }
}
@keyframes blingbling {
  0% {
    filter: saturate(100%);
  }
  80% {
    filter: saturate(200%);
  }
  100% {
    filter: saturate(100%);
  }
}
@keyframes marquee {
  from {
    transform: translateX(0);
  }
  to {
    transform: translateX(-50%);
  }
}
